import React from 'react';
import { Link } from 'react-router-dom';

class Header extends React.Component {
  render() {
    return (
      <>
        <Link to="/"></Link>
        <Link to="/home"></Link>
        <Link to="/about"></Link>
        <Link to="/contact"></Link>
      </>
    );
  }
}

export default Header;
